        fontFamily: "helvetica",
        height: 30,
        textAlign: "center",
        margin: 5,
        borderRadius: 5,
        fontStyle: "italic"
    },
    addJogador: {
        flexDirection: "row",
        alignItems: "center",
        justifyContent: "space-between",
    },
    listItem: {
        flexDirection: "row",
        alignItems: "center",
        margin: 5,
    },
    image: {
        width: 30, 
        height:30
